var utilMethods = {
  // 数据运算，将小数转为整数计算 symbol +-*/符号
  amendVal: function amendVal(num1, num2, symbol) {
    var str1 = num1.toString();
    var str2 = num2.toString();
    var result;
    var str1Length;
    var str2Length;
    // 解决整数没有小数点方法
    try {
      str1Length = str1.split('.')[1].length;
    } catch (error) {
      str1Length = 0;
    }
    try {
      str2Length = str2.split('.')[1].length;
    } catch (error) {
      str2Length = 0;
    }
    var step = Math.pow(10, Math.max(str1Length, str2Length));
    // 处理类似这类小数转整数也会失精度，所以转整数后再四舍五入取整下 8969.3 * 100 = 896929.999999999999，18.24 * 100 = 1823.9999999999998
    num1 = Math.round(num1 * step);
    num2 = Math.round(num2 * step);
    switch (symbol) {
      case '+':
        result = (num1 + num2) / step;
        break;
      case '-':
        result = (num1 - num2) / step;
        break;
      case '*':
        result = num1 * num2 / step / step;
        break;
      case '/':
        result = num1 / num2;
        break;
      default:
        break;
    }
    return result;
  }
};
